import React from 'react'
import { Divider } from 'semantic-ui-react'

const Footer = () => {

    return (
        <div>
        <Divider inverted section />
            2019학년도 홍익대학교 미술대학 학생회
            개별 작품 이미지 및 설명에 대한 저작권은 각 작가에게 있습니다.
        </div>
    )

}


export default Footer
